import { Button } from '@material-ui/core';
import { useHistory  } from "react-router-dom";
import '../home.css';

function homebtns(props) {
	
  const routeChange = () =>{ 
    let path = `Login`;
    props.history.push(path);
  }
  const register = () =>{ 
    let path = `register`; 
    props.history.push(path);
  }
  return (
    <div>
	    <Button className="button_style" variant="contained" color="primary" size="small"   onClick={routeChange} >Login</Button>
	     <Button onClick={register} className="button_style"  variant="contained"color="primary"size="small" >Register</Button>
	    </div>
  )
}

export default homebtns
